        #preloader {
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            z-index: 99;
            opacity:1;
            background: repeating-linear-gradient(45deg, #3d203e, #b90037);
            background: repeating-linear-gradient(-45deg, #ee7752, #e73c7e, #23a6d5, #23d5ab);
            background: repeating-radial-gradient(#aaaaaa, #ffffff);
            background: repeating-linear-gradient(45deg, #3986d9 , #efc96d, #c9411a);
            background: repeating-linear-gradient(45deg, #08203e, #4684ee);

            background-size: 400% 400%;
            animation: gradient 4s ease infinite;

            -webkit-transition: opacity 200ms ease-in-out;
            -moz-transition: opacity 200ms ease-in-out;
            transition: opacity 200ms ease-in-out;

        }

        @keyframes gradient {
            0% {

                background-size: 100% 200%;
            }
            50% {

                background-size: 400% 400%;
            }
            100% {
                
                background-size: 200% 100%;
            }
        }
